import React, { useState, useEffect } from 'react'
import styled from 'styled-components'
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import AccountCircleOutlinedIcon from '@material-ui/icons/AccountCircleOutlined';

const VR = () => {
  return (
    <Container>
        <div className="vr-shape">
            <div className="screen">
                <img src="https://eu-images.contentstack.com/v3/assets/blt6b0f74e5591baa03/blt4138e585008d15dd/631967d86519941c4d578e63/sanjose.jpg?width=850&auto=webp&quality=95&format=jpg&disable=upscale" alt="" />
            </div>
            <div className="vr-btns">

            </div>
        </div>
    </Container>
  )
}

export default VR

const Container = styled.div`
    height: 100vh;
    width: 100vw;
    background-color: #171616;
    display: grid;
    place-items: center;

    .vr-shape{
        height: 500px;
        width: 1000px;
        position: relative;
        /* background-color: black; */

        border-radius: 30px;
        border: 1px solid #ccc1c1;
        background-color: white;

        display: grid;
        place-items: center;

        padding: 10px;

        .screen{
            height: 450px;
            width: 950px;
            background-color: orange;
            border-radius: 20px;
            overflow: hidden;

            img{
                height: 100%;
                width: 100%;
            }
        }

        .vr-btns{
            position: absolute;
            bottom: 35px;
            left: 75px;
            height: 50px;
            width: 850px;
            background: white;
            border-radius: 20px;
        }
    }
`
